import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";

interface Store {
  store_id: number;
  store_name: string;
  store_description: string;
  store_address: string;
  store_opening_hours: string;
  store_phone_number: string;
  store_url: string;
  store_img: string;
  tags: { id: number; name: string }[];
}

interface Tag {
  id: number;
  name: string;
  tag_type: number;
}

const HospitalStoreList: React.FC = () => {
  const { prefectureId } = useParams<{ prefectureId: string }>();
  const [store, setStore] = useState<Store[]>([]);
  const [type4Tag, setType4Tag] = useState<Tag[]>([]);
  const [selectedTagIds, setSelectedTagIds] = useState<number[]>([]);
  const [selectedPrefecture, setSelectedPrefecture] = useState<string>("");
  const [error, setError] = useState<string | null>(null);

//店舗データの取得
  useEffect(() => {
    const fetchStores = async () => {
      try {
        let url =
          selectedTagIds.length === 0
            ? `http://localhost:5003/stores/list/store-type/${prefectureId}/4`
            : `http://localhost:5003/stores/list/tag/${prefectureId}?tagIds=${selectedTagIds.join(",")}`;
        const response = await fetch(url);
        const data = await response.json();
        setStore(data);
      } catch (error) {
        setError("病院データの取得に失敗しました。");
      }
    };
    fetchStores();
  }, [prefectureId, selectedTagIds]);

  useEffect(() => {
    const fetchTags = async () => {
      try {
        const response = await fetch(`http://localhost:5003/tags`);
        const data: Tag[] = await response.json();
        const type4 = data.filter((tag) => tag.tag_type === 4);
        setType4Tag(type4);
      } catch (err) {
        setError("タグデータの取得に失敗しました。");
      }
    };
    fetchTags();
  }, []);

  useEffect(() => {
    const prefectureNames: { [key: string]: string } = {
      "1": "札幌",
      "13": "東京",
      "14": "神奈川",
      "23": "愛知",
      "26": "京都",
      "27": "大阪",
      "28": "兵庫",
    };
    setSelectedPrefecture(prefectureNames[prefectureId ?? ""] || "動物病院の情報がありません");
  }, [prefectureId]);

  const handleTagClick = (tagId: number) => {
    setSelectedTagIds((prev) =>
      prev.includes(tagId) ? prev.filter((id) => id !== tagId) : [...prev, tagId]
    );
  };

  return (
    <div style={{ textAlign: "center", padding: "20px", backgroundColor: "#FAF3E0" }}>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {selectedPrefecture === "動物病院の情報がありません" ? (
        <h2 style={{ fontWeight: "bold" }}>{selectedPrefecture}</h2>
      ) : (
        <>
          <h2 style={{ fontWeight: "bold" }}>{selectedPrefecture}の動物病院</h2>
          <div
            style={{
              display: "flex",
              flexWrap: "wrap",
              justifyContent: "center",
              gap: "10px",
              marginBottom: "20px",
            }}
          >
            {type4Tag.map((tag) => (
              <button
                key={tag.id}
                onClick={() => handleTagClick(tag.id)}
                style={{
                  backgroundColor: selectedTagIds.includes(tag.id) ? "grey" : "white",
                  color: "#282d27",
                  padding: "10px 15px",
                  border: "1px solid #333",
                  borderRadius: "20px",
                  cursor: "pointer",
                  fontSize: "15px",
                }}
              >
                {tag.name}
              </button>
            ))}
          </div>
          {store.length > 0 ? (
            store.map((storeItem) => (
              <Link key={storeItem.store_id} to={`/hospital/detail/${storeItem.store_id}`}>
                <div
                  style={{
                    marginBottom: "30px",
                    border: "1px solid #000000",
                    borderRadius: "10px",
                    padding: "20px",
                    backgroundColor: "#fff",
                  }}
                >
                  <img
                    src={storeItem.store_img}
                    alt={storeItem.store_name}
                    style={{ width: "400px", height: "300px", borderRadius: "10px" }}
                  />
                  <p style={{ fontWeight: "bold" }}>{storeItem.store_name}</p>
                  <p>{storeItem.store_description}</p>
                  <p>
                    <strong>住所:</strong> {storeItem.store_address}
                  </p>
                  <p>
                    <strong>営業時間:</strong> {storeItem.store_opening_hours}
                  </p>
                  <p>
                    <strong>電話:</strong> {storeItem.store_phone_number}
                  </p>
                  <a href={storeItem.store_url} target="_blank" rel="noopener noreferrer">
                    お店の詳細
                  </a>
                </div>
              </Link>
            ))
          ) : (
            <p>動物病院の情報がありません</p>
          )}
        </>
      )}
    </div>
  );
};

export default HospitalStoreList;
